from typing import List
class Solution:
    def longestOnes(self, nums: List[int], k: int) -> int:
        l = 0
        for r in range(len(nums)):
            k -= 1-nums[r] # if k < 0 then we have consumed all flips
            if k < 0:
                k += 1 - nums[l] # optionally add back zero flips if moving pointer removed a 0 
                l +=1
        return r - l + 1
                

